script: |
  super -f text -I q11093.spq | sort > q11093.out

inputs:
  - name: q11093.spq
    data: |
      SELECT ALL - MAX ( col1 ) FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 * - col2 + col0 * col2 NOT IN ( - col0, ( - col2 ) + + - col2, + + ( + col1 ) );
  - name: tab2

outputs:
  - name: q11093.out
    data: |
      -77
